// ==UserScript==
// @name         GGn Forum Game Banned Group Highlighter
// @version      1.5.5
// @author       SleepingGIant
// @namespace    https://greasyfork.org/users/1395131
// @description  Highlight adult groups in all forums and detect unchained posts Game Title Chains
// @match        https://gazellegames.net/forums.php?*action=viewthread*&threadid=*
// @downloadURL https://update.greasyfork.org/scripts/535943/GGn%20Forum%20Game%20Banned%20Group%20Highlighter.user.js
// @updateURL https://update.greasyfork.org/scripts/535943/GGn%20Forum%20Game%20Banned%20Group%20Highlighter.meta.js
// ==/UserScript==
(function () {
    'use strict';

    function scanForumPosts() {
        const isGameTitleChain = window.location.href.includes("threadid=29022");
        const posts = Array.from(document.querySelectorAll('td.body'));
        let previousTitle = null;

        posts.forEach((bodyTd) => {
            const torrentLinks = bodyTd.querySelectorAll('a[href*="torrents.php?id="]');
            torrentLinks.forEach(torrentLink => {
                const match = torrentLink.href.match(/id=(\d+)/);
                if (match) {
                    const torrentId = match[1];
                    highlightIfAdult(bodyTd, torrentId);
                }
            });

            if (isGameTitleChain) {
                // This is a bit jank, but you can't get forum body text content raw because it will include e.g. edit strings.
                const lines = bodyTd.textContent
                    .split('\n')
                    .map(line => line.trim())
                    .filter(line => line.length > 0);

                const rawTitle = lines[0] || "";
                const cleanedTitle = rawTitle.toLowerCase().replace(/[^a-z]/g, '');

                if (previousTitle) {
                    const longestOverlap = getLongestCommonSubstring(previousTitle, cleanedTitle);
                    const hasValidOverlap = longestOverlap && longestOverlap.length >= 4;

                    if (!hasValidOverlap) {
                        applyWarningStyle(bodyTd, "⚠️ Likely not chained!", 'rgba(254,254,51, 0.3)');
                    }

                    const block = document.createElement('div');
                    block.style.marginTop = '10px';
                    block.style.fontFamily = 'monospace';
                    block.style.whiteSpace = 'pre';

                    const prevLine = highlightOverlapAndAlign(previousTitle, cleanedTitle, longestOverlap);
                    const currLine = highlightOverlapAndAlign(cleanedTitle, previousTitle, longestOverlap);

                    block.innerHTML = prevLine + '\n' + currLine;
                    bodyTd.appendChild(block);
                }

                previousTitle = cleanedTitle;
            }
        });
    }

    function highlightOverlapAndAlign(str, otherStr, overlap) {
        if (!overlap) return str;

        const strIndex = str.indexOf(overlap);
        const otherIndex = otherStr.indexOf(overlap);
        const pad = Math.max(0, otherIndex - strIndex);
        const before = str.slice(0, strIndex);
        const match = `<span style="background-color:blue;color:white;">${str.slice(strIndex, strIndex + overlap.length)}</span>`;
        const after = str.slice(strIndex + overlap.length);
        return ' '.repeat(pad) + before + match + after;
    }

    function getLongestCommonSubstring(a, b) {
        let longest = '';
        for (let i = 0; i < a.length; i++) {
            for (let j = i + 1; j <= a.length; j++) {
                const sub = a.slice(i, j);
                if (b.includes(sub) && sub.length > longest.length) {
                    longest = sub;
                }
            }
        }
        return longest || null;
    }

    function highlightIfAdult(postElement, torrentId) {
        if (adult_groups.includes(torrentId)) {
            applyWarningStyle(postElement, "⚠️ Likely adult group!", 'rgba(200, 8, 21, 0.5)');
        }
    }

    function applyWarningStyle(postElement, warningText, backgroundColor) {
        postElement.style.backgroundColor = backgroundColor;
        postElement.style.border = '2px solid red';

        const warningMessage = document.createElement('div');
        warningMessage.textContent = warningText;
        warningMessage.style.color = 'red';
        warningMessage.style.fontWeight = 'bold';
        warningMessage.style.marginTop = '10px';
        postElement.appendChild(warningMessage);
    }

    window.addEventListener('load', scanForumPosts);
})();





